import './fonts/DMMono-Regular.ttf';
import { FaGithub, FaEnvelope, FaLinkedin, FaSeedling } from 'react-icons/fa';
import './App.css';
import Sidebar from './components/sidebars';


class App extends Component {
	render() {
		return (
			    <div >
			    	<div class="homepage">
	      				<header class="App-header">
	      					<div class="name" > <b> ISHITA KORDE </b> </div>
	      					<div class="circle"> </div>
		        		</header>

		        		<div class = "sidebar-bkgd">
			       	 		<p class="sidebar"> <b> about  </b> </p>
			       	 		<p class="sidebar"> <b> resume  </b> </p>
			       	 		<br />
