			       	 		<p class="sidebar"> <b> <FaLinkedin size="1.4em"/>  </b> </p>
		       	 		</div>

		       	 		<div class= "about">
		       	 			<div class="title"><b> hi, </b></div>
		       	 			<div class="list"> I'm a Computer Science graduate with an interest in developing technology for earth's betterment. 
		       	 			<br />
		       	 			I believe technology is crucial in moving the world towards sustainable practices and reducing carbon emissions. </div>
		       	 			<br />
		       	 			<div class="title"> CURRENT PROJECTS</div>
		       	 			<div class="list"> <FaSeedling size="0.7em" color='#689791'/> Computer Vision nanodegree via Udacity</div>
		       	 			<div class="list"> <FaSeedling size="0.7em" color='#689791'/> Building raised beds for home garden</div>
		       	 			<div class="list"> <FaSeedling size="0.7em" color='#689791'/> Attempting handstands </div>
		       	 		</div>
	       	 		</div>


      			</div>

		)
	}
}

export default App;
